import React from "react";

export default function Swap() {
  return (
    // center div with glassmorphism
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "40vh",
        width: "30vw",
        //glassmorphism with black background

        //add black glass effect

        //add border
        border: "1px solid rgba(255, 255, 255, 0.2)",
        //add blur
        backdropFilter: "blur(4px)",
        //rounded corners
        borderRadius: "10px",
      }}>
      //add heading in top left corner with seetting icon in top right corner
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          width: "100%",
          height: "10%",
        }}>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100%",
            width: "100%",
          }}>
          <h1>Swap</h1>
        </div>
      </div>
    </div>
  );
}
